[6.7.1][Android] topBar rightButtons property enabled: false crashes application,"### Issue Description

When creating a modal with the property `enabled: false` in the topBar rightButtons causes the application to crash.

- I know this was not happening on version 4.8.4 together with  react-native 0.61.5.
- leftButtons are fine. I tried to reproduce it too there and all seems alright.
- Only happens in modals. I tried in regular screens and it's also alright.

