```js
/** @typedef {{ email: string, nickName?: string }} U2 */

/** @type {U2} */
const u2 = { email: """" }
```

**Actual behavior:**
`U2` in `/** @type {U2} */` is marked deprecated.

While I dislike `@typedef` as much as the next programmer, we shouldn't mark every alias created with it as deprecated.","Bug,Fix Available",Mark @typedef as a type declaration,This is only important right now for marking uses of deprecated tags due to the way that deprecated type references are computed. But I'm surprised it hasn't caused problems elsewhere.

